import React, { Component } from 'react';
import img1 from './img1.jpg';
import img2 from './img2.jpg'
import img3 from './img3.jpg'


class Shop extends Component {

  constructor(props){
    super(props);
    this.state={
      counter1:0,
      counter2:0,
      counter3:0,
      counter4:0
      
    };
  };
  firstincrement(){
    this.setState({
      counter1:this.state.counter1 +1
    })
  };
  firstdecrement(){
    this.setState({
      counter1:this.state.counter1 -1
    })
  };
  
  secondincrement(){
    this.setState({
      counter2:this.state.counter2 +1
    })
  };
  seconddecrement(){
    this.setState({
      counter2:this.state.counter2 -1
    })
  };

  thirdincrement(){
    this.setState({
      counter3:this.state.counter3 +1
    })
  };
  thirddecrement(){
    this.setState({
      counter3:this.state.counter3 -1
    })
  };

  fourincrement(){
    this.setState({
      counter4:this.state.counter4 +1
    })
  };
  fourdecrement(){
    this.setState({
      counter4:this.state.counter4 -1
    })
  };
  



  render() {
    return (
      <div>
        
            {/* this is shop */}
            <div class="card-group">
  <div class="card">
    <img src={img1} height= "400" width= "10" class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
      <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
    </div>
  </div>
  <div class="card">
    <img src={img2} height= "400" width= "10" class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">This card has supporting text below as a natural lead-in to additional content.</p>
      <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
    </div>
  </div>
  <div class="card">
    <img src={img3} height= "400" width= "10" class="card-img-top" alt="..."/>
    <div class="card-body">
      <h5 class="card-title">Card title</h5>
      <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This card has even longer content than the first to show that equal height action.</p>
      <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
    </div>
  </div>
</div>
        
        </div>
        );
    }
  }
  
  export default Shop;
